//import '../styles/styles.css';

const MyFirstView = () => {
    return (
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          alignContent: "center",
        }}
      >
        <div
          style={{
            width: "300px",
            height: "300px",
            background: "red",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            flexDirection: "column",
          }}
        >
          <div style={{ padding: "15px" }}>
            <label style={{ display: "block" }}>Correo Electrónico</label>
            <input />
          </div>
          <div style={{ padding: "15px" }}>
            <label style={{ display: "block" }}>Contraseña </label>
            <input />
          </div>
          <button style={{ padding: "10px", margin: "auto" }}>
            Iniciar Sesión
          </button>
        </div>
      </div>
    );
}

export default MyFirstView;
